    constructor() {
      super();
      this.state ={
        products: data.products
       }
      };
  render() {
  return (
    <div className="App">

      <Logout />
      <Navbar />
    <div className='grid-container'>
      <h1>pizza hut</h1>
      <main>
       <div className="content">
       <div className="main">
        <Products products={this.state.products}></Products>
   </div>
   <div className="sidebar">Cart Items</div>
       </div>

    </main>

</div>
      </div>
  )
}
}
export default App;
